import React from 'react';

class Location extends React.Component {
  constructor(props) {
    super(props);
  }

  render = () => {
    return (
      <div className="locationListItem">
        <h3>{this.props.location.name}</h3>
        <div>{this.props.location.address} {this.props.location.suite}{"\n"}{this.props.location.city}, {this.props.location.state} {this.props.location.zip}</div>
        <div><button className="Button__StyledButton-sc-1uvogdt-0 eDBmXb btn btn-brand">Order </button></div>
        <hr className="locationListItem-break"/>
      </div>
    );
  }
}

export default Location;
